import Header from '../Header'
import Landing from '../Landing'
import { BrowserRouter, Route } from 'react-router-dom'
import Footer from '../Footer'
import '../../App.css';

function App() {
  return (

    <div className="App">
      <Header />
      <Landing />
      <Footer />
      <BrowserRouter>
      <Route path="../Identification">
      <Identification />
      </Route>
    </BrowserRouter> 
      </div>
  );
}

export default App;
